import React from "react";
import {StyleSheet,View,Text,TextInput,Button} from "react-native";
import {Formik} from "formik";
import * as yup from"yup";
import {RadioButton} from "react-native-paper";
const ReviewSchema=yup.object({
    fullname:yup.string().required().min(2).max(10),
    emailid:yup.string().required(),
    password:yup.string(),
    confirmpassword:yup.string,
});
export default function UserDetails({navigation})
{
    const onSubmitHandler=()=>{
        console.log(value);
        console.log("going to other page");
    }
    const [value, setValue] = React.useState(1);

    return (
        <View>
            <Formik initialValues={{fullname:'',emailid:'',password:'',confirmpassword:''}}
            validationSchema={ReviewSchema}
            onSubmit={(values,actions)=>{
                // addreview(values);
                console.log(values);
                actions.resetForm();

            }}>
                {(props)=>(
                    <View >
                        <Text>Enter Full Name</Text>
                        <TextInput  placeholder='Enter Full Name' value={props.values.fullname} onChangeText={props.handleChange('fullname')}/>
                        <Text>{props.touched.fullname && props.errors.fullname}</Text>
                        <Text>Email Id</Text>
                        <TextInput  placeholder='Email Id' value={props.values.emailid} onChangeText={props.handleChange('emailid')}/>
                        <Text>{props.touched.emailid && props.errors.emailid}</Text>
                        <Text>password</Text>
                        <TextInput  placeholder='password' value={props.values.password} onChangeText={props.handleChange('password')}/>
                        <Text>{props.touched.password && props.errors.password}</Text>
                        <Text>confirm password</Text>
                        <TextInput  placeholder='confirm password' value={props.values.confirmpassword} onChangeText={props.handleChange('confirmpassword')}/>
                        <Text>{props.touched.confirmpassword && props.errors.confirmpassword}</Text>
                        <RadioButton.Group onValueChange={newValue => setValue(newValue)} value={value} >
    <View style={styles.radio}>
      <View style={styles.radio1}>

        <RadioButton title="scasc1"value={1} />
        <Text>female</Text>
      </View>
      <View style={styles.radio1}>

        <RadioButton value={2} />
        <Text>male</Text>
      </View>
      <View style={styles.radio1}>

        <RadioButton value={3} />
        <Text>other</Text>
      </View>
      </View>
    </RadioButton.Group>
                        <Button  title="Continue" onPress={()=>{props.handleSubmit();onSubmitHandler()}}/>
                    </View>
                )}
        </Formik>
        </View>
    )
}
const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
    radio:{
      flexDirection:'row',
    },
    radio1:{
      flexDirection:'row'
    }
  });
